Vector CBaseEntity::GetHitboxPos(int hitbox_id)
{
	matrix3x4_t boneMatrix[128];

	if (SetupBones(boneMatrix, 128, BONE_USED_BY_HITBOX, 0.0f)) {
		auto studio_model = Interfaces.g_pModelInfo->GetStudioModel(GetModel());
		if (studio_model) {
			auto hitbox = studio_model->GetHitboxSet(0)->pHitbox(hitbox_id);
			if (hitbox) {
				auto
					min = Vector{},
					max = Vector{};

				g_Math.VectorTransform(hitbox->bbmin, boneMatrix[hitbox->bone], min);
				g_Math.VectorTransform(hitbox->bbmax, boneMatrix[hitbox->bone], max);

				return (min + max) / 2.0f;
			}
		}
	}
	return Vector{};
}

float NormalizeFloatToAngle(float input)
{
	for (auto i = 0; i < 3; i++) {
		while (input < -180.0f) input += 360.0f;
		while (input > 180.0f) input -= 360.0f;
	}
	return input;
}

