void vectorangles(const Vector& forward, QAngle& angles)
{
	float	tmp, yaw, pitch;

	if (forward[1] == 0 && forward[0] == 0) {
		yaw = 0;
		if (forward[2] > 0)
			pitch = 270;
		else
			pitch = 90;
	}
	else {
		yaw = (atan2(forward[1], forward[0]) * 180 / PI);
		if (yaw < 0)
			yaw += 360;

		tmp = sqrt(forward[0] * forward[0] + forward[1] * forward[1]);
		pitch = (atan2(-forward[2], tmp) * 180 / PI);
		if (pitch < 0)
			pitch += 360;
	}

	angles[0] = pitch;
	angles[1] = yaw;
	angles[2] = 0;
}

QAngle calcangle(Vector src, Vector dst)
{
	QAngle angles;
	Vector delta = dst - src;

	vectorangles(delta, angles);

	return angles;
}

float getStaticLBY(CBaseEntity* player) {
	float e_vecHead = player->GetLowerBodyYaw();
	float p_vecHead = Hacks.LocalPlayer->GetEyePosition().y;
	float tmp = p_vecHead - e_vecHead;
	tmp = NormalizeFloatToAngle(tmp);
	return tmp;
}

float AtTarget(CBaseEntity* pTarget) {

	CBaseEntity* pLocal = Hacks.LocalPlayer;
	Vector eye_position = pLocal->GetEyePosition();
	Vector target_position = pTarget->GetEyePosition();
	float pReturn = calcangle(target_position, eye_position).y;

	return pReturn - 180.f;
}

