bool Resolver::didLBYUpdate(C_BasePlayer* player)
{
	int curTarget = player->EntIndex();

	double cTime = player->GetSimulationTime() + g_PlayerSettings[curTarget].lastSimTimeDelta;

	//
	// Animation based resolver
	//
	for (int s = 0; s < 13; s++)
	{
		auto anim_layer = player->GetAnimOverlay(s);
		if (!anim_layer.m_pOwner)
			continue;

		auto activity = player->GetSequenceActivity(anim_layer.m_nSequence);

		if (activity == -1) //If idle animation, skip it
			continue;
		if (activity == 979 && (anim_layer.m_flWeight == 0.f || anim_layer.m_flCycle > 0.862494) && (g_GlobalVars->curtime - oldStoredCurtime[curTarget]) < 2.f  && player->GetVecVelocity().Length2D() < 38.f)
		{
			//if (GetAsyncKeyState(VK_RCONTROL))
			//	ATLTRACE2(std::string("flCycle" + std::to_string(anim_layer.m_flCycle) + "\n").c_str());

			//Balance-check triggered saves the last lby update if the resolver misses
			storedLBYFromUpdate[curTarget] = player->GetLowerBodyYaw();
			Resolver::lbyUpdate[player->EntIndex()] = true;
			// store last angle 
			oldStoredCurtime[curTarget] = cTime + 1.1;
			return true;
		}
	}

	return false;
}

